CREATE TABLE rekam_medis(
   id_rekam_medis       VARCHAR(5) NOT NULL PRIMARY KEY
  ,id_dokter            VARCHAR(5) NOT NULL
  ,id_pasien            VARCHAR(5) NOT NULL
  ,tgl_rekam_medis      DATE  NOT NULL
  ,ket_rekam_medis      VARCHAR(50) NOT NULL
  ,tindakan_rekam_medis VARCHAR(50) NOT NULL
  ,penyakit_rekam_medis VARCHAR(8) NOT NULL
);

create sequence rekam_medis_sq
  minvalue 1
  maxvalue 999999999
  start with 1
  increment by 1
  cache 20;

create or replace trigger rm_sq
before insert on rekam_medis
for each row
declare
  new_id varchar(5);
  cur_id number;
begin
  if inserting and :new.id_rekam_medis is null then
    cur_id := rm_sq.nextval;
    if cur_id < 10 then
      select concat('M000', cur_id) into new_id from dual;
    else
      if cur_id < 100 then
        select concat('M00', cur_id) into new_id from dual;
      else cur_id < 1000 THEN
        select concat('M0', cur_id) into new_id from dual;
      else
        select concat('M', cur_id) into new_id from dual;
      end if;
    end if;
  :new.id_rekam_medis := new_id;
  end if;
end;


